import React from "react";
import styles from "./button.module.css";

const button = (props) => {
  return (
    <button
      className={[styles.btn, props.btnType].join(" ")}
      onClick={props.clicked}
      style={{ ...props.className }}
    >
      {props.children}
    </button>
    // <button
